import { GoogleGenAI } from '@google/genai';

// Initialize Vertex with your Cloud project and location
const ai = new GoogleGenAI({
  apiKey: process.env.GOOGLE_CLOUD_API_KEY,
});
const model = 'gemini-3-pro-image-preview';


// Set up generation config
const generationConfig = {
  maxOutputTokens: 32768,
  temperature: 1,
  topP: 0.95,
  responseModalities: ["TEXT", "IMAGE"],
  imageConfig: {
    aspectRatio: "1:1",
    imageSize: "1K",
    outputMimeType: "image/png",
  },
  safetySettings: [
    {
      category: 'HARM_CATEGORY_HATE_SPEECH',
      threshold: 'OFF',
    },
    {
      category: 'HARM_CATEGORY_DANGEROUS_CONTENT',
      threshold: 'OFF',
    },
    {
      category: 'HARM_CATEGORY_SEXUALLY_EXPLICIT',
      threshold: 'OFF',
    },
    {
      category: 'HARM_CATEGORY_HARASSMENT',
      threshold: 'OFF',
    }
  ],
};

const msg1Text1 = {text: `Create professional e-commerce fashion photos.
Place the outfit from the first image
onto the model in the second image.
Generate realistic full-body shots of the model wearing the outfit,
adjusting lighting and shadows to match an outdoor environment.`};
const msg1Image1 = {
  inlineData: {
    mimeType: 'image/jpeg',
    data: ''
  }
};
const msg1Image2 = {
  inlineData: {
    mimeType: 'image/png',
    data: ''
  }
};

const chat = ai.chats.create({
  model: model,
  config: generationConfig
});

async function sendMessage(message) {
  const response = await chat.sendMessageStream({
    message: message
  });
  process.stdout.write('stream result: ');
  for await (const chunk of response) {
    if (chunk.text) {
      process.stdout.write(chunk.text);
    } else {
      process.stdout.write(JSON.stringify(chunk) + '\n');
    }
  }
}

async function generateContent() {
  await sendMessage([
    msg1Text1, msg1Image1, msg1Image2
  ]);
}

generateContent();